import React from 'react';
import {HeaderPage} from './styles'
import { Link } from 'react-router-dom';

export default function Header(props) {
    return (
    <React.Fragment>
      <HeaderPage>
          <div>
          <Link to="/">Listagem</Link> 
          <Link to="/">Cadastro</Link> 
          </div>

      </HeaderPage>
    </React.Fragment >
  );
}
